import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider, AuthContext } from './context/AuthContext';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './components/Home';
import ServiceList from './components/ServiceList';
import MasterList from './components/MasterList';
import Login from './components/Login';
import Register from './components/Register';
import AddService from './components/AddService';
import AddMaster from './components/AddMaster';
import UserProfile from './components/UserProfile';

const App = () => {
  const { isAuthenticated } = React.useContext(AuthContext);

  return (
    <AuthProvider>
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/services" element={<ServiceList />} />
          <Route path="/masters" element={<MasterList />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/add-service" element={isAuthenticated ? <AddService /> : <Navigate to="/login" />} />
          <Route path="/add-master" element={isAuthenticated ? <AddMaster /> : <Navigate to="/login" />} />
          <Route path="/profile" element={isAuthenticated ? <UserProfile /> : <Navigate to="/login" />} />
        </Routes>
        <Footer />
      </Router>
    </AuthProvider>
  );
};

export default App;
